  state = {
    theme: 'dark'
  }

  render() {
    const contents = [
      { title: 'Section 1', id: 'section1', content: 'dummyText' },
      { title: 'Section 2', id: 'section2', content: 'dummyText' },
      { title: 'Section 3', id: 'section3', content: 'dummyText' },
      { title: 'Section 4', id: 'section4', content: 'dummyText' },
      { title: 'Section 5', id: 'section5', content: 'dummyText' },
    ]

    const allContent = (
      <div>
        {contents.map((content, index) => {
        return <ContentArea />
      })}
      </div>

    );

    return (
      <div className={styles.App}>
        <Navbar theme={this.state.theme} />
        <ContentArea
          title="Section 1"
          content={dummyText}
          theme={this.state.theme}
          id="section1" />
        <ContentArea
          title="Section 2"
          content={dummyText}
          theme={this.state.theme}
          id="section2" />
        <ContentArea
          title="Section 3"
          content={dummyText}
          theme={this.state.theme}
          id="section3" />
        <ContentArea
          title="Section 4"
          content={dummyText}
          theme={this.state.theme}
          id="section4" />
        <ContentArea
          title="Section 5"
          content={dummyText}
          theme={this.state.theme}
          id="section5" />
      </div>
    );
  }
}

export default App;
